import React from "react";
import { Container, Card, CardContent, Typography, CardHeader } from "@mui/material";

const birthdayList = ({people})=>{
    return(
        <Container>
            {people.map((person)=>{
                const {id, name, age, image} = person;
                return(
                    <Card key={id}>
                        <CardHeader>
                            <img src={image} alt={name} />
                            <Typography varaint="h4" component="h4" gutterbottom>
                                {name}
                            </Typography>
                            <Typography>
                                {age} years
                            </Typography>
                        </CardHeader>
                    </Card>
                )
            })}
        </Container>
    )
}

export default birthdayList;
